    <>
      <Navbar bg="dark" fixed="top" style={{ padding: '1rem 1rem' }}>
        <Navbar.Brand bsPrefix="">
          <Link to="/">HoaQua</Link>
        </Navbar.Brand>
      </Navbar>
    </>
  );
};

export default Header;
